  selector: 'app-add-cliente',
  templateUrl: './add-cliente.component.html',
  styleUrls: ['./add-cliente.component.css']
})
export class AddClienteComponent {
  clientes:Cliente[] = [ ];
  clienteName:string = "";
  clientePrice:string = "";
  clienteEmail:string = "";
  clienteProvincia:string = "";
  clienteDestino:string = "";
  @ViewChild("it1") myNameElem!: ElementRef;
  @ViewChild("it2") myNameElem2!: ElementRef;
  @ViewChild("it3") myNameElem3!: ElementRef;
  @ViewChild("it4") myNameElem4!: ElementRef;
  @ViewChild("it5") myNameElem5!: ElementRef;


  constructor(private clienteService:ClientesService){}

  public addCliente(){    
    this.clienteService.broadCastClienteName(this.myNameElem.nativeElement.value, 
                                            this.myNameElem2.nativeElement.value, );
                                            this.myNameElem3.nativeElement.value
                                            this.myNameElem4.nativeElement.value
                                            this.myNameElem5.nativeElement.value

    this.clienteService.sendClientes(this.myNameElem.nativeElement.value,
                                      this.myNameElem2.nativeElement.value)

  }
}
